webpackJsonp(13,{46:function(a,b,c){a.exports='<h1>Getting started</h1><p>The only required files are <a href="http://jquery.com">jQuery</a> and <a href="#builder">jmpress.js</a> to use.</p><p>For a quick and simple example look at the <a href="https://github.com/shama/jmpress.js/blob/beta/examples/simple/index.html">examples/simple/index.html</a> and <a href="https://github.com/shama/jmpress.js/blob/beta/examples/simple/simple.css">examples/simple/simple.css</a>.</p><h2>Migrating from impress.js</h2><p>Currently jmpress.js includes all of the impress.js features and a lot more.</p><p>To migrate simply add jQuery, change impress.js to jmpress.js and call <code>$(selector).jmpress();</code> to initialize. Take a look at the <a href="http://shama.github.com/jmpress.js/examples/impress/">impress.js running on jmpress.js</a> example.</p>'}})